package programming;

public class PatternExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int f = 1;
		int i = 1;
		 for( i=1;i<=9;i=i+2)
		    {
		    for(int no=f;no<=i;no++)
		    {
		      System.out.print(no);
		    }
		    System.out.println();
		    f++;
		    
	}

}
}
